bool are_equivalent(float *a, float *b, float epsilon, int size)
{
    for (int i = 0; i < size; i++)
    {
        float diff = abs(a[i] - b[i]);
        if (diff > epsilon)
        {
            printf("- maximum absolute error is : %f\n", diff);
            printf("- a[%d] = %f and b[%d] = %f\n", i, a[i], i, b[i]);
            return false;
        }
    }
    return true;
}

